/////////////////////////////////// CONV3D_1 ///////////////////////////////////
void conv3d_CONV3D_1(register const Tensor in, register Tensor out){
	for (register VSize k=0; k<8; k++){
		for (register VSize i=0; i<=4; i++){
			for (register VSize j=0; j<=3; j++){
				for (register VSize d=0; d<3; d++){
					register Scalar cell = CONV3D_1_BIAS[k];
					for (register VSize l=0; l<3; l++){
						cell += dot(&in[mat_index3(3,7,6,d,i,j)], &CONV3D_1_KERNELS[mat_index3(8,3,3,k,l,0)], 3);
					}
					out[mat_index4(3,5,4,8,d,i,j,k)] = cell;
				}
			}
		}
	}
}
/////////////////////////////////// DENSE_1 ////////////////////////////////////
void dense_DENSE_1(register const Vector in, register const Vector out){
	r_matmul(DENSE_1_WEIGHTS, in, out, 256, 608);
	i_add(out, DENSE_1_BIAS, 256);
}

/////////////////////////////////// DENSE_2 ////////////////////////////////////
void dense_DENSE_2(register const Vector in, register const Vector out){
	r_matmul(DENSE_2_WEIGHTS, in, out, 1, 256);
	i_add(out, DENSE_2_BIAS, 1);
}/////////////////////////////////// NN Model ///////////////////////////////////
float nn_network(register const Vector input){
    Vector conv3d = (Vector)(Scalar[608]){};
    Vector dense1 = (Vector)(Scalar[256]){};
    Vector dense2 = (Vector)(Scalar[1]){};
    conv3d_CONV3D_1(input, conv3d);
    i_relu(conv3d, 480);
    for (VSize i=0; i<128; i++){
        conv3d[480+i] = 1024*input[i];
    }
    // memcpy(&conv3d[480], input, sizeof(Scalar)*128);
    dense_DENSE_1(conv3d, dense1);
    i_relu(dense1, 256);
    for (VSize i=0; i<256; i++){
        dense1[i] = dense1[i]/1024;
    }
    dense_DENSE_2(dense1, dense2);
    return _tanh(((float)dense2[0])/(1024*1024));
}

void _nn_encode(Vector res, uint64_t bb){
    for (uint8_t c=0; c<7; c++){
        for (uint8_t r=0; r<6; r++){
            res[41-r-6*c] = ((bb&(1ULL<<(c*7+r))) != 0);
        }
    }
}

void nn_encode(Vector r, uint64_t bb1, uint64_t bb2, uint8_t player){
    if (!player){
        uint64_t tmp = bb1;
        bb1 = bb2;
        bb2 = tmp;
    }
    _nn_encode(&r[0], bb1);
    _nn_encode(&r[42], bb2);
    for (register VSize i=84; i<126; i++){
        r[i] = 1-_min(r[i-42]+r[i-84], 1);
    }
    r[126] = player;
    r[127] = 1-player;
}

